import React from 'react';
import { Link } from '@reach/router';
import { Button } from 'semantic-ui-react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { faPagelines } from '@fortawesome/free-solid-svg-icons'

const LandingPage = () => {

    return (
        <div className="wrapper">
            <header>
                <h1>Planthood <FontAwesomeIcon icon={["fab", "faPagelines"]} /></h1>
                <Button className="blue"><Link style={{ "color": "black" }} to={"/"}>Log In</Link></Button>
            </header>
            <div className="landingDisplay"></div>
        </div>
    )
}

export default LandingPage
